import React from 'react'

const styles = {
  main: {
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center',
    alignItems: 'center',
    width: '98vw',

    backgroundColor: 'darkseagreen'
  },
  carouselContainer: {
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'center',
    alignItems: 'center',
    width: '100%',
    height: '100%',

    backgroundColor: 'lightgray'
  }

}

function appStyles() {
  return (
    <div>
      {styles}
    </div>
  )
}

export default appStyles
